import React from "react";
import { FaStar, FaStarHalfAlt, FiStar } from "react-icons/fa";

export default function Rating(props) {
  const { rating, numReviews } = props;
  return (
    <div className="rating">
      <span>
        <i
          className={
            rating >= 1 ? (
              <FaStar />
            ) : rating >= 0.5 ? (
              <FaStarHalfAlt/>
            ) : (
              <FiStar />
            )
          }
        ></i>
      </span>
      <span>
        <i
          className={
            rating >= 2 ? (
              <FaStar />
            ) : rating >= 1.5 ? (
              <FaStarHalfAlt/>
            ) : (
              <FiStar />
            )
          }
        ></i>
      </span>
      <span>
        <i
          className={
            rating >= 3 ? (
              <FaStar />
            ) : rating >= 2.5 ? (
              <FaStarHalfAlt />
            ) : (
              <FiStar />
            )
          }
        ></i>
      </span>
      <span>
        <i
          className={
            rating >= 4 ? (
              <FaStar />
            ) : rating >= 3.5 ? (
              <FaStarHalfAlt />
            ) : (
              <FiStar />
            )
          }
        ></i>
      </span>
      <span>
        <i
          className={
            rating >= 5 ? (
              <FaStar />
            ) : rating >= 4.5 ? (
              <FaStarHalfAlt />
            ) : (
              <FiStar />
            )
          }
        ></i>
      </span>
      <span>{numReviews} reviews</span>
    </div>
  );
}
